import React from 'react'
import {list, ListItem, ListItemAvatar, ListItemText} from '@material-ui/core';

function Todo(props) {
    return (
        <list>
            <ListItem> 
                <ListItemAvatar>
                </ListItemAvatar>
                    <ListItemText primary="Todo" secondary={props.todo}>
                    </ListItemText>
            </ListItem>
        </list>
    )
}

export default Todo
